    pivot = lst[pivotIndex]
    while low <= high:
        while low < len(lst) and lst[low] <= pivot:
            low += 1
        while lst[high] > pivot:
            high -= 1
        if low < high:
            (lst[low], lst[high]) = (lst[high], lst[low])
    (lst[high], lst[pivotIndex]) = (lst[pivotIndex], lst[high])
    return high

